import { useState } from "react";
import Login from './pages/Login';
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import DoctorLogin from './pages/DoctorLogin';
import PatienLogin from './pages/PatientLogin';
import Signup from './pages/Signup';
import AdminLogin from './pages/Admin/AdminLogin';
import AdminDashboard from './pages/Admin/AdminDashboard';
import AdminTopbar from "./pages/Admin/Topbar";
import AdminSidebar from "./pages/Admin/Sidebar";
import AdminHospital from "./pages/Admin/hospital";
import AdminPatient from "./pages/Admin/patient";
import AdminGeography from "./pages/Admin/geography";
import { CssBaseline, ThemeProvider } from "@mui/material";
import { ColorModeContext, useMode } from "./theme";

function App() {
  const [theme, colorMode] = useMode();
  const [isSidebar, setIsSidebar] = useState(true);

  return (
    <ColorModeContext.Provider value={colorMode}>
      <ThemeProvider theme={theme}>
        <CssBaseline />
        <div className="App">
          <Router>
            <Routes>
              <Route exact path="/" element={<Login />} />
              <Route exact path="/doctorlogin" element={<DoctorLogin />} />
              <Route exact path="/patientlogin" element={<PatienLogin />} />
              <Route exact path="/signup" element={<Signup />} />
              <Route exact path="/adminlogin" element={<AdminLogin />} />
              <Route exact path="/admindashboard" element={<AdminDashboard />} />
              <AdminSidebar isSidebar={isSidebar} />
              <main className="content">
                <AdminTopbar setIsSidebar={setIsSidebar} />
                  <Routes>
                    <Route path="/admindashboard" element={<AdminDashboard />} />
                    <Route path="/adminhospital" element={<AdminHospital />} />
                    <Route path="/adminpatient" element={<AdminPatient />} />
                    <Route path="/geography" element={<AdminGeography />} />
                  </Routes>
              </main>
            </Routes>
          </Router>
        </div>
      </ThemeProvider>
    </ColorModeContext.Provider>
  );
}

export default App;
